import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';


function Contact() {
  return (
    <section id="contact" className="bg-dark text-white py-5">
      <div className="container">
        <h2 className="display-4 text-orange">Contact Me</h2>
        <p>Want to collaborate? Reach out!</p>
        <div className="mt-4">
          <a href="mailto:your-email@example.com" className="text-white mx-3">
            <FontAwesomeIcon icon={faEnvelope} size="2x" />
          </a>
          <a href="https://linkedin.com/in/your-profile" className="text-white mx-3">
            <FontAwesomeIcon icon={faLinkedin} size="2x" />
          </a>
          <a href="https://github.com/your-github" className="text-white mx-3">
            <FontAwesomeIcon icon={faGithub} size="2x" />
          </a>
        </div>
      </div>
    </section>
  );
}

export default Contact;
